  Code = "class Solution:\n    def findIntersectionValues(self, nums1: List[int], nums2: List[int]) -> List[int]:\n        freqs1, freqs2 = [0] * 101, [0] * 101\n        for num in nums1:\n            freqs1[num] += 1\n        for num in nums2:\n            freqs2[num] += 1\n        res1, res2 = 0, 0\n        for num, freq in enumerate(freqs1):\n            if freqs2[num] > 0:\n                res1 += freq\n        for num, freq in enumerate(freqs2):\n            if freqs1[num] > 0:\n                res2 += freq\n        return res1, res2"
